import Banner from "../components/Banner";
import BoxArticle from "../components/BoxArticle";
import DashboardFooter from "../components/DashboardFooter";
import DashboardItems from "../components/DashboardItems";
import TextLabel from "../components/TextLabel";
import { itemsHomeArticles } from "../constants/AppConstants";
import { itemsHomeBoxArticle } from "../constants/AppConstants";
import React, { useState } from "react";
import "./Home.css";
let Home = () => {
  const [seed, setSeed] = useState();
  const reset = () => {
    setSeed(Math.random());
  };
  return (
    <div>
      <div className="container-fluid">
        <Banner bannerId="tm-main-bg" />

        <main>
          <section className="tm-welcome">
            <TextLabel name="Welcome to Turkey" />

            <div className="row tm-welcome-row">
              <DashboardItems data={itemsHomeArticles[0]} />
              <DashboardItems data={itemsHomeArticles[1]} />
              <DashboardItems data={itemsHomeArticles[2]} />
              <DashboardItems data={itemsHomeArticles[3]} />
            </div>

            <div className="row tm-welcome-row-2">
              <BoxArticle data={itemsHomeBoxArticle[0]} />
              <BoxArticle data={itemsHomeBoxArticle[1]} />
              <BoxArticle data={itemsHomeBoxArticle[2]} />
            </div>
          </section>

          <DashboardFooter key={seed} />
        </main>
      </div>
    </div>
  );
};

export default Home;
